  `Class_Rank` varchar(255) DEFAULT NULL,
  PRIMARY KEY (`Rank_ID`)
) ENGINE=InnoDB AUTO_INCREMENT=4 DEFAULT CHARSET=utf8mb4;

# ------------------------------------------------------------
# SCHEMA DUMP FOR TABLE: results
